import React from 'react';
import Express from './Express'; // Путь к компоненту Express

function Page() {
  // Получаем данные из компонента Express
  const data = Express();

  return (
    <div>
      <h1>Данные из Express:</h1>
      <ul>
        {/* Проверяем, есть ли данные перед их использованием */}
        {data && data.length > 0 ? (
          data.map(item => (
            <li key={item.img}>{/* Выводим данные */}</li>
          ))
        ) : (
          <li>Нет данных</li>
        )}
      </ul>
    </div>
  );
}

export default Page;
